// components/Sidebar.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChartBar, faBox, faClipboardList, faUsers, faPlus } from '@fortawesome/free-solid-svg-icons';
import './Sidebar.css'; // Importing CSS file for styling

const Sidebar = () => {
  const [title, setTitle] = useState('Admin Dashboard');

  const handleItemClick = (newTitle) => {
    setTitle(newTitle);
  };

  return (
    <div className="sidebar">
      <h2>{title}</h2>
      <ul>
        <li onClick={() => handleItemClick('Dashboard')}>
          <Link to="/dashboard">
            <FontAwesomeIcon icon={faChartBar} />
            <span>Dashboard</span>
          </Link>
        </li>
        <li onClick={() => handleItemClick('Products')}>
          <Link to="/products">
            <FontAwesomeIcon icon={faBox} />
            <span>Products</span>
          </Link>
        </li>
        <li onClick={() => handleItemClick('Orders')}>
          <Link to="/orders">
            <FontAwesomeIcon icon={faClipboardList} />
            <span>Orders</span>
          </Link>
        </li>
        <li onClick={() => handleItemClick('Customers')}>
          <Link to="/customers">
            <FontAwesomeIcon icon={faUsers} />
            <span>Customers</span>
          </Link>
        </li>
        <li onClick={() => handleItemClick('Create')}>
          <Link to="/create">
            <FontAwesomeIcon icon={faPlus} />
            <span>Create</span>
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
